import React, { useEffect, useState } from "react";
import axios from "axios";
import { useCookies } from "react-cookie";
import { useNavigate } from "react-router-dom";
import Blog from "../Components/users/Blog";
import Course from "../Components/users/Course";
import TProfile from "../Components/users/TProfile";

const AccountTrainers = () => {
  const [user, setUser] = useState([]);
  const [page, setPage] = useState("TProfile");
  const [photoPreview, setPhotoPreview] = useState(null);
  const [cookies, setCookie, removeCookie] = useCookies(['token']);
  const history = useNavigate();

  useEffect(() => {
    axios
      .get("http://localhost:5000/user")
      .then((response) => {
        setUser(response.data);
        setPhotoPreview(response.data.profile_image_name);
      })
      .catch((error) => {
        console.error("Error fetching user data:", error);
      });
  }, []);

  const logout = () => {
    removeCookie('token');
    removeCookie('user_id');
    removeCookie('role_id');
    history("/");
  };

  const [isSideOpen, setIsSideOpen] = useState(true);
  const [position, setPosition] = useState("left-0");

  const openSideBar = () => {
    const newPosition = isSideOpen ? "-left-64" : "left-0";
    setPosition(newPosition);
    setIsSideOpen(!isSideOpen);
  };

  return (
    <div className="flex flex-wrap mt-24">
      {/* sidebar */}
      <div className="relative w-[260px] h-full">
        <div
          className={`peer absolute top-0 border ${position} lg:left-0 h-full w-full object-cover transition-all delay-100 duration-1000`}
        >
          <button
            aria-label="toggle sidebar"
            id="openSideBar"
            className={`${
              isSideOpen ? "hidden" : "flex"
            } lg:hidden h-10 w-10 bg-gray-600 absolute right-0 mt-16 -mr-10 items-center shadow rounded-tr rounded-br justify-center cursor-pointer focus:outline-none focus:ring-2 focus:ring-offset-2 rounded focus:ring-re`}
            onClick={openSideBar}
          >
            {/* أيقونة القائمة */}
          </button>
          <button
            aria-label="Close sidebar"
            id="closeSideBar"
            className={`${
              isSideOpen ? "block" : "hidden"
            } lg:hidden h-10 w-10 bg-grey-600 absolute right-0 mt-16 -mr-10 flex items-center shadow rounded-tr rounded-br justify-center cursor-pointer text-white`}
            onClick={openSideBar}
          >
            {/* أيقونة الإغلاق */}
          </button>
          <aside className="flex flex-col w-64 h-auto px-5 py-8 overflow-y-auto bg-black border-r rtl:border-r-0 rtl:border-l dark:border-gray-700">
  <div className="flex flex-col justify-between flex-1 mt-6">
    <nav className="-mx-3 space-y-6">
      <div className="space-y-3">
        <label className="px-3 text-xs text-grey-700 uppercase dark:text-gray-400">
          Manage Account
        </label>

        {["TProfile", "Course", "Blog"].map((navItem) => (
          <button
            key={navItem}
            className={`w-full flex items-center px-3 py-2 transition-colors duration-300 transform rounded-lg dark:text-gray-200 hover:bg-re dark:hover:bg-re dark:hover:text-gray-200 hover:text-gray-100 ${
              page === navItem ? "bg-re text-gray-100" : "text-gray-300"
            }`}
            onClick={() => setPage(navItem)}
          >
            <span className="mx-2 text-sm font-medium">{navItem}</span>
          </button>
        ))}
      </div>

      <div className="space-y-3">
        <button
          className="flex items-center px-3 py-2 transition-colors duration-300 transform rounded-lg dark:text-gray-200 hover:bg-re dark:hover:bg-re dark:hover:text-gray-200 hover:text-gray-100"
          onClick={logout}
        >
          {/* أيقونة الخروج */}
          <span className="mx-2 text-sm font-medium">Log Out</span>
        </button>
      </div>
    </nav>
  </div>
</aside>
        </div>
      </div>

      {/* content */}
      <div className={`${page === "TProfile" ? "block" : "hidden"} w-full`}>
        <TProfile />
      </div>

      <div className={`${page === "Course" ? "block" : "hidden"} w-full`}>
        <Course />
      </div>

      <div className={`${page === "Blog" ? "block" : "hidden"} w-full`}>
        <Blog />
      </div>
    </div>
  );
};

export default AccountTrainers;
